import React from 'react';
import "./AutoImageUploadCSS.css";

const AutoImageUpload = (props) => {
    const {image} = props;
    return (
        <div>
            <img className='img-thumbnail' src={image}/>
        </div>
    );
};

export default AutoImageUpload;
